import React from 'react';
import ListTD from './ListTD';
import ListArr from './ListArrTD';

function ListMainTD(){
    return (
        <>
        <div className="frm">
            <input type="text" />
            <span><Button>Click</Button></span>
        </div>
       { ListArr.map((value,index)=>{
        return(
            <ListTD 
            Key ={value.id}
            desc={value.desc}
            />
        )
       })}
        </>
    )
}
export default ListMainTD;
